import React, { useState } from 'react';
import './CreateTreatementIn.css'; // Import the CSS file for styling

function CreateTreatementIn() {
    const [treatmentProfiles, setTreatmentProfiles] = useState([{ treatmentProgress: '', result: '', advice: '' }]);
    const [inputValues, setInputValues] = useState({ treatmentProgress: '', result: '', advice: '' });
  
    const handleAddProfile = () => {
      setTreatmentProfiles((prevProfiles) => [...prevProfiles, { ...inputValues }]);
      setInputValues({ treatmentProgress: '', result: '', advice: '' });
    };
  
    const handleInputChange = (e) => {
      setInputValues((prevValues) => ({
        ...prevValues,
        [e.target.name]: e.target.value,
      }));
    };
  
    return (
      <div className="profile-page">
        <h2>Profile</h2>
        <div className="profile-details">
          <div>
            <label>Name:</label>
            <input type="text" value="John Doe" readOnly />
          </div>
          <div>
            <label>ID:</label>
            <input type="text" value="123456" readOnly />
          </div>
          <div>
            <label>Gender:</label>
            <input type="text" value="Male" readOnly />
          </div>
          <div>
            <label>Treatment Date:</label>
            <input type="text" value="2023-06-28" readOnly />
          </div>
        </div>
        <div className="input-form">
          <h3>Treatment Profile</h3>
          {treatmentProfiles.map((profile, index) => (
            <div className="treatment-profile" key={index}>
              <input
                type="text"
                value={profile.treatmentProgress}
                readOnly
                placeholder="Treatment Progress"
              />
              <input type="text" value={profile.result} readOnly placeholder="Result" />
              <input type="text" value={profile.advice} readOnly placeholder="Advice" />
            </div>
          ))}
          <div className="add-profile">
            <input
              type="text"
              name="treatmentProgress"
              value={inputValues.treatmentProgress}
              onChange={handleInputChange}
              placeholder="Add Treatment Progress"
            />
            <input
              type="text"
              name="result"
              value={inputValues.result}
              onChange={handleInputChange}
              placeholder="Add Result"
            />
            <input
              type="text"
              name="advice"
              value={inputValues.advice}
              onChange={handleInputChange}
              placeholder="Add Advice"
            />
            <button className="add-profile-button" onClick={handleAddProfile}>
              Add
            </button>
          </div>
        </div>
        <div className="action-buttons">
          <button className="complete-button">Complete</button>
          <button className="reappoint-button">Re-appoint</button>
        </div>
      </div>
    );
  };

export default CreateTreatementIn;
